import React from 'react'

import {
    Container,
    HorizontalContainer, 
    Line,
    VerticalContainer
} from './styled'

const BackgroundLinesComponent = () => {   

    const renderLines = () => {
        let item = [];
        for (let i = 0; i < 8; i++) {
          item.push(
            <Line 
              key={ i }
            />
          );
        }
        return item;
    };

    return (
        <Container>
            <HorizontalContainer>
                {renderLines()}
            </HorizontalContainer>
            <VerticalContainer>
                {renderLines()}
            </VerticalContainer>

            {/* <TopContainer>
                {renderLines()}
                {renderLines()}
            </TopContainer> */}
        </Container>
    )
}


export default BackgroundLinesComponent;
